import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import Sdata from './Sdata'

ReactDOM.render(
    <>
    <h1 className="heading_style">List of top 5 Netflix Series in 2019</h1>
    <Card 
    imgsrc={Sdata[0].imgsrc}
    title={Sdata[0].title}
    sname={Sdata[0].sname}
    link={Sdata}
    />
    <Card
    imgsrc="https://i0.wp.com/www.korseries.com/wp-content/uploads/2020/04/extracurricular-review.jpg?fit=1000%2C596&ssl=1"
    title="A Netflix Original Series"
    sname="EXTRACURRICULAR"
    link="https://www.netflix.com/in/title/80990668"
    />
    <Card
    imgsrc="https://i.pinimg.com/736x/1c/f4/bb/1cf4bb4bf3d8d51461bfb75472e23cd1.jpg"
    title="A Netflix Original Series"
    sname="STRANGER THINGS"
    link="https://www.netflix.com/in/title/80057281"
    />
    </>
    ,document.getElementById('root'));
